Pattern = ""

def ReverseComplement(Pattern):
    # Return the reversed complement of a Pattern
    result = ""
    for i in Pattern:
        if i == "A":
            result = result + "T"
        elif i == "T":
            result = result + "A"
        elif i == "C":
            result = result + "G"
        elif i == "G":
            result = result + "C"
    return (result[::-1])

print(ReverseComplement(Pattern))